import keyConceptsImage from "./assets/images/key-concepts.png";
import componentsImage from "./assets/images/components.png";
import stateImage from "./assets/images/state.png";
import eventsImage from "./assets/images/events.png";

function Concepts() {
  return (
    <ul id="concepts">
      <li className="concept">
        <img src={componentsImage} alt="componentsImage" />
        <h2>{concepts[0].title}</h2>
        <p>{concepts[0].description}</p>
      </li>
      <li className="concept">
        <img src={stateImage} alt="stateImage" />
        <h2>{concepts[1].title}</h2>
        <p>{concepts[1].description}</p>
      </li>
      <li className="concept">
        <img src={eventsImage} alt="eventsImage" />
        <h2>{concepts[2].title}</h2>
        <p>{concepts[2].description}</p>
      </li>
    </ul>
  );
}

export default Concepts;
